//author: Barbara Li Santi//supplied to CS 64 in Spring 2019 for the second midterm exampackage for_exam_2;public class DoubleLinkRing<E> {	private DoubleLinkNode<E> myStart;  	public DoubleLinkRing() {		myStart = null; // Picture AA	}//constructor	public boolean add (E addMe) {		if (myStart == null) {			myStart = new DoubleLinkNode<E>(addMe);// Picture BB			return true;		} //if empty ring		DoubleLinkNode<E> found = search(addMe);//Picture CC		if(found != null){			return false;//not adding duplicates		}//if duplicate found		DoubleLinkNode<E> temp = 				new DoubleLinkNode<E>(addMe,myStart,myStart.myPrevious);// Picture DD		myStart.myPrevious.myNext = temp;// Picture EE		myStart.myPrevious = temp;// Picture FF		return true;	}// add	public DoubleLinkNode<E> search (E findMe) {		if (myStart == null) {			return null;		}//if		if ( findMe.equals(myStart.myData) ) {			return myStart;		}//if		DoubleLinkNode<E> aux = myStart.myNext;// Picture GG		while ( aux != myStart && !findMe.equals(aux.myData)) {			aux = aux.myNext;// Picture HH		} //while		return (aux == myStart ? null : aux );	}// search	public boolean delete(E deleteMe) {		DoubleLinkNode<E> d = search (deleteMe);// Picture II		if ( d == null ) {			return false;		}//if		if (d == d.myNext ) {			myStart = null;// Picture JJ			return true;		}//if		d.myPrevious.myNext = d.myNext;// Picture KK		d.myNext.myPrevious = d.myPrevious;// Picture LL		if ( d == myStart ) {			myStart = myStart.myNext;// Picture MM		}//if		return true;	}// delete	public String toString() {		if ( myStart == null ) {			return "no data";		}//if		String temp = myStart.myData + "\n";		DoubleLinkNode<E> aux = myStart.myNext;		while ( aux != myStart ) {			temp += aux.myData + "\n";			aux = aux.myNext;		} // while		return temp;	} // toString}//DoubleLinkRing